define("CheckoutPrescription.ServiceController",
  [
    "ServiceController",
    "JJ.CheckoutPrescription.CheckoutPrescription"
  ],
  function (
    ServiceController,
    CheckoutPrescription
  ) {
    "use strict";

    return ServiceController.extend({
      name: "CheckoutPrescription.ServiceController",
      post: function () {
        try {
          var requestBody = this.request.getBody();
          if (!requestBody) {
            return JSON.stringify({
              success: false,
              message: "No data received for processing"
            });
          }
          var parsedData = JSON.parse(requestBody);
          if (!parsedData.files || !Array.isArray(parsedData.files) || parsedData.files.length === 0) {
            return JSON.stringify({
              success: false,
              message: "Invalid or missing files array"
            });
          }
          return CheckoutPrescription.uploadCheck(parsedData);
        } catch (error) {
          nlapiLogExecution("ERROR", "Error in Service Controller", error.toString());
          return JSON.stringify({
            success: false,
            message: "An error occurred while processing the request"
          });
        }
      }
    });
  });

define('JJ.CheckoutPrescription.CheckoutPrescription', ['SC.Model', 'underscore', 'Configuration'], function (
	SCModel, _, Configuration
) {
	'use strict';

	return SCModel.extend({
		name: 'JJ.CheckoutPrescription.CheckoutPrescription',

		uploadCheck: function (data) {
			try {
				var folderId = Configuration.get('CheckoutPrescription.config');
				var files = data.files;
				var uploadedFileIds = [];
				if (!files || files.length === 0 || !folderId) {
					return JSON.stringify({
						success: false,
						message: "Missing files or folder ID"
					});
				}
				files.forEach(function (file) {
					var base64 = file.checkData;
					var fileType = file.imagefiletype;
					var fileName = file.imageName;
					if (fileType && base64 && fileName) {
						var uploadedFile = nlapiCreateFile(fileName, fileType, base64);
						uploadedFile.setFolder(folderId);
						var fileId = nlapiSubmitFile(uploadedFile);
						uploadedFileIds.push(fileId);
					}
				});
				return JSON.stringify({
					success: true,
					uploadedFileIds: uploadedFileIds
				});
			} catch (error) {
				nlapiLogExecution("ERROR", "Unexpected Error in uploadCheck", error.toString());
				return JSON.stringify({
					success: false,
					message: "An error occurred while uploading files"
				});
			}
		}
	});
});

